When con man Nat (Christopher Walken) convinces his
straitlaced son, Flynn (Alessandro Nivola), to join
him on a road trip, the two learn a few things
about each other as they drive to New Mexico
attempting to live on no more than $5 a day. While
they scam their way across the country, Flynn deals
with the resentment he feels for his estranged
father. (Flynn once served jail time for one of
Nat's shady deals.) Amanda Peet and Sharon Stone
